window.bookSummaryJSON = "<p>What do you do when the game resets around you?&nbsp;</p> <p>Just when Montana thought he had life in Vuldranni figured out, the rug is pulled out from under him. He's alone once again, but now he's in the crosshairs of the man who would be emperor, and a whole host of people are counting on Montana to provide a safe haven for them.&nbsp;</p> <p>Montana has one hope of actually completing his quest of forming a dukedom: he needs to bust Nikolai out of prison.&nbsp;</p> <p>A prison that no one has ever escaped from alive.&nbsp;</p> <p>A prison whose only exit is little more than rumor and probably doesn't even exist - through a sentient dungeon, hell-bent on causing torture, inflicting pain, and extracting the ultimate price: life.&nbsp;&nbsp;&nbsp;</p> <p>Montana and his hir√∞men are down to their last chance. So they get themselves arrested and enter Osterstadt prison. Can the Good Guys do good by going bad?</p>"; 
